import React from "react";

const name = "Steven";
const interests = ["I like sports", "I like my dog", "I like food"]

function HelloDiv() {
  return <div>
  <h1>Hello! My name is {name} </h1>
    <ul>
    <li>{interests[0]}</li>
    <li>{interests[1]}</li>
    <li>{interests[2]}</li>
  </ul>
  </div>
}

export default HelloDiv;
